import {
  Grid,
  Card,
  CardContent,
  CardActions,
  Typography,
  Button
} from "@mui/material";
import Chart from "react-apexcharts";
import {
  useState
} from "react";
const Revenue = ()=>{
  const[series,setSeries] = useState([
    {
      name:"Profit",
      data: [10,15,60,30]
    },
    {
      name: "Loss",
      data: [4,40,10,30]
    }
  ])
  const[options,setOptions] = useState({
    xaxis:{
      categories: [
        new Date().toLocaleDateString(),
        new Date().toLocaleDateString(),
        new Date().toLocaleDateString(),
        new Date().toLocaleDateString()
      ]
    },
    theme:{
      mode: "light",
      palette: "palette2"
    },
    legend:{
      fontSize: 40,
      position: "bottom",
      horizontalAlign: "center"
    }
  })
  const design = (
    <>
      <Grid item xs={12} sm={6}>
      <Card>
      <CardContent>
      <Typography gutterBottom variant="h5" component="div">
          Revenue Updates
      </Typography>
      <Chart
        options={options}
        series={series}
        type="line"
        height="350px"
      >
      </Chart>
      </CardContent>

      </Card>
      </Grid>
    </>
  );
  return design;
}

export default Revenue;
